INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8, 40, 2834, 0, "フリーマーケット会場", 5118061, 2, 10118, 91002, "ペコリーヌとの出会い", 20063115, 7, "青空の下で謁見", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8, 40, 2835, 0, "フリーマーケット会場", 5118062, 2, 10118, 91002, "マホとの出会い", 20063115, 7, "未来の騎空団\nマスコット？", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8, 40, 2837, 0, "ランドソル市街地", 5118063, 2, 10118, 91002, "アキノとの出会い", 20063115, 7, "お嬢さまからの\n緊急依頼", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8, 40, 4108402, 0, "フリーマーケット会場", 5118064, 2, 10118, 91002, "ジュンとの出会い", 20063115, 18, "黄金色の悩みごと", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8, 40, 4107402, 0, "フリーマーケット会場", 5118065, 2, 10118, 91002, "カオリとの出会い", 20063115, 18, "白熱！　格闘大会！", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8, 40, 9000227, 1, "オーエド町", 5118066, 2, 10118, 91002, "ニノンとの出会い", 20063115, 16, "祭り太鼓はオーエドの華", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8, 40, 2101181, 0, "フリーマーケット会場", 5118067, 3, 10118, 91002, "スズナとの出会い", 20063115, 19, "人気者は遅れて\nやってくる", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8, 40, 4109402, 0, "ランドソル市街地", 5118068, 3, 10118, 91002, "ナナカとの出会い", 20063115, 18, "巫女・ミーツ・魔法少女", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8, 40, 4305402, 0, "フリーマーケット会場", 5118069, 3, 10118, 91002, "キャル＆コッコロとの出会い", 20063115, 18, "ネズ耳は二度なくなる", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8, 40, 4101402, 0, "ランドソル市街地", 5118070, 3, 10118, 91002, "ユカリとの出会い", 20063115, 18, "この出会いにカンパイ！", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8, 40, 4106402, 0, "ランドソル市街地", 5118071, 3, 10118, 91002, "アオイとの出会い", 20063115, 18, "陰陽アンサンブル", 1);
INSERT INTO `v1_46b82f0940d45740d0d1bbab1bb19fa68604251304c3324472af96e9ca583c7a` VALUES ("ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8, 40, 2836, 1, "フリーマーケット会場", 5118072, 3, 10118, 91002, "シノブとの出会い", 20063115, 7, "運試し十番勝負！", 1);
